import React from "react";
import { Layout, Card, FormLayout, TextField } from "constants";

export default function PageMarkup() {
  const resourceNamee = {
    singular: "Charity",
    plural: "Charities"
  };

  const charities = [
    {
      ein: "680259824",
      charityName: "PACIFIC COAST FISH WILDLIFE AND WETLANDS ASSOC",
      url: "http://www.orghunter.com/organization/680259824",
      city: "ARCATA",
      state: "California"
    },
    {
      ein: "260253627",
      charityName: "MENDOCINO COUNTY COOPERATIVE AERIALFIRE PATROL",
      url: "http://www.orghunter.com/organization/260253627",
      city: "WILLITS",
      stat: "California"
    }
  ];

  return (
    <Page title="Charities for Category">
      <Layout>
        <Layout.AnnotatedSection
          title="Please select a charity below"
          description="Possible subtitle"
        >
          <Card>
            <ResourceList
              items={charities}
              renderItem={charity}
              resourceName={resourceName}
            />
          </Card>
        </Layout.AnnotatedSection>

        <Layout.AnnotatedSection
          title="Pacific Coast Fish Wildife and Wetlands"
          description="Possible Description"
        >
          <Card>
            <FormLayout>
              <TextField
                label="Identification Number"
                disabled
                value={"680259824"}
              />
              <TextField
                type="Location"
                disabled
                value={"Arcata, California"}
              />
            </FormLayout>
          </Card>
        </Layout.AnnotatedSection>
      </Layout>
    </Page>
  );
}
